contract MINEX is ERC20, Ownable {

    uint256 public exchangeRate = 300; // 1 USDT = 300 X Coins
    uint256 public referralReward = 5; // 5% (default)
    uint256 public totalReferralsDistributed;

     //Testnet
    IERC20Metadata public paymentToken = IERC20Metadata(0x337610d27c682E347C9cD60BD4b3b107C9d34dDd);

    address public marketingWallet;

    struct Referral {
        address referrer;
        uint256 tokensEarned; // Tokens earned from this referral
    }

    mapping(address => Referral[]) public referrals;
    mapping(address => uint256) public totalReferralEarnings;
    mapping(address => bool) public hasPurchased;

    event Buy(address indexed buyer, uint256 amount);
    event Sell(address indexed seller, uint256 amount);
    
    constructor() ERC20("Mine X", "X") { 

        marketingWallet = _msgSender();

        _mint(address(this), 2000000000 * (10**18));
    }

   /// @notice Creates `_amount` token to `_to`. Must only be called by the owner (Staking Contract).
    function mint(address _to, uint256 _amount) external  onlyOwner {
        _mint(_to, _amount);
    }

    function setReferralReward(uint256 _reward) external {
        require(_msgSender() == marketingWallet, "only marketing wallet can access!");
        referralReward = _reward;
    }

    function addReferral(address _referrer, address _referee, uint256 _tokensEarned) internal  {
        referrals[_referrer].push(Referral(_referee, _tokensEarned));
        totalReferralEarnings[_referrer] += _tokensEarned;
    }

    function getReferrals(address _referrer) public view returns (Referral[] memory) {
        return referrals[_referrer];
    }

    function getTotalReferralEarnings(address _referrer) public view returns (uint256) {
        return totalReferralEarnings[_referrer];
    }

    function usdtToToken(uint256 usdtAmount) external  view returns (uint256){
        return  (usdtAmount) * exchangeRate;
    }
    
    function tokenToUsdt(uint256 tokenAmount) external  view returns (uint256){
        return  (tokenAmount) / exchangeRate;
    }

    function buy(uint256 usdtAmount, address referrer) external {
        uint256 xAmount = (usdtAmount) * exchangeRate;

        uint256 ourAllowance = paymentToken.allowance(
            _msgSender(),
            address(this)
        );
        require(usdtAmount <= ourAllowance, "Make sure to add enough allowance");
        (bool success, ) = address(paymentToken).call(
            abi.encodeWithSignature(
                "transferFrom(address,address,uint256)",
                _msgSender(),
                address(this),
                usdtAmount
            )
        );

        require(success, "Token payment failed");

        // Handle referral 
        if (!hasPurchased[_msgSender()] && referrer != address(0) && referrer != _msgSender() && hasPurchased[referrer]) {
            uint256 reward = (xAmount * referralReward) / 100;
            addReferral(referrer, _msgSender(), reward);
            super._transfer(address(this), referrer, reward);
            totalReferralsDistributed += reward;           

        }

         hasPurchased[msg.sender] = true;
        super._transfer(address(this), _msgSender(), xAmount);
        emit Buy(_msgSender(), xAmount);
    }

    function sell(uint256 xAmount) external {
        uint256 usdtAmount = (xAmount / exchangeRate);

        super._transfer(_msgSender(), address(this), xAmount);

        IERC20(paymentToken).transfer(_msgSender(), usdtAmount); 
        
        emit Sell(_msgSender(), xAmount);
    }

    function changeMarketingWallet(address newWallet) external {
      require(_msgSender() == marketingWallet, "only marketing wallet can access!");
      marketingWallet = newWallet;
    }

    function recoverFunds(uint256 amount) external {
        require(_msgSender() == marketingWallet, "only marketing wallet can access!");
        IERC20(paymentToken).transfer(_msgSender(), amount);
    }
}

